import { StyleSheet } from 'react-native';

export default StyleSheet.create({
  container: {
    height: '100%',
    paddingHorizontal: '8%',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  button: {
    alignSelf: 'stretch',
  },
});
